import React from "react";

function Profile() {
  return (
    <div className="profileContainer">
      <img
        src="../Recources/Images/unnamed-removebg-preview.png"
        id="logo"
        alt="Uploaded"
      />
      <label id="profileName">Yair Gabay</label>
      <div className="Bio">
        <label id="description">
          Now is the winter of our discontent Made glorious summer by this sun
          of York; And all the clouds that lour'd upon our house In the deep
          bosom of the ocean buried.
        </label>
      </div>
    </div>
  );
}

export default Profile;
